import React from "react";
import { Link } from "react-router-dom";

export function Model({ data, id }) {
  return (
    <div>
      {data.map((item) => {
        return (
          <Link to={`/product/${id}/${item.name}`}>
            <li key={item.index}>
              {item.name} {item.nb_place}
            </li>
          </Link>
        );
      })}
    </div>
  );
}

export function Caracteristique() {
  return <div className="container_caract"></div>;
}
